                        "4.1 推广方式\n\t\t\t\t（1）甲方将带有乙方ID的推广物料（独有渠道号标识）交付乙方，乙方负责线上推广，用户通过乙方渠道访问推广资源。\n\t\t\t\t（2）充值金额最终以手游平台数据为准。如双方确认的数据与手游平台数据有差距的，在甲方取得手游平台数据后的10日内，与乙方就有出入部分的数据进行数据修正。\n\t\t\t\t（3）如发生用户退费，甲乙双方应相应扣减充值数据。如退费部分的充值优惠返利已消耗的，则甲方有权要求乙方退还或在之后新产生的充值优惠返利中扣减。\n\t\t\t\t4.2 数据统计周期\n\t\t\t\t1-5个工作日，如遇系统维护等特殊情况，数据统计周期将相应延长。\n\t\t\t\t4.3 充值优惠：\n\t\t\t\t（1）甲方承诺：经乙方推广产生的推广资源充值，甲方给予返利优惠（以充值数据*返利比例计算，每款游戏的返利比例以甲方通知为准，1久币记为1人民币）。\n\t\t\t\t（2）该比例甲方可能根据市场情况进行调整，但甲方应提前通知乙方，如乙方不同意调整后优惠幅度，则乙方有权终止本协议，乙方继续履行本协议项下的义务的，视为同意调整后的优惠幅度。\n\t\t\t\t（3）返利优惠用作兑换充值服务。\n\t\t\t\t4.4 双方各自独立缴纳因此而产生的相关税款。"
